import React from "react";

const Skillsection = () => {
    return (
        <div className="skillsection-container">

            <div className="skill-subtitle">
                <h2>-My Hard Skills-</h2>
            </div>

            <div className="front-skills">
                <h3>-Front End</h3>
            </div>
        </div>
    )
}

export default Skillsection;
